import React from 'react';
function LeftSection({imageURL,productName,productdescription,tryDemo,learnMore,googlePlay,appStore}) {
    return ( 
        <div className="container">
            <div className="row">
                <div className="col-md-6">

                </div>
                <div className="col-md-6">
                    <img src={imageURL}/>
                </div>

            </div>

        </div>
     );
}

export default LeftSection;
